import React from 'react'

export  function Frame() {
  return (
   <div>
    <div className='interest-small'>
    <div className='mat-small'>
        <div className='art-small'>
        <img src="images/gallery/IMG2.jpg" alt="" />
        </div>
    </div>
  </div>
   </div>

  )
}

export  function Large() {
    return (

  //     <div className='interest'>
