  //       <div className='art'>
  //       <img src="images/gallery/IMG2.jpg" alt="" />
  //       </div>
  //   </div>
  // </div>


      <div className='interest-large'>
      <div className='mat-large'>
          <div className='art-large'>
          <img src="images/gallery/IMG2.jpg" alt="" />
          </div>
      </div>
    </div>

    )
  }

  export  function Medium() {
    return (
      <div className='interest-medium'>
      <div className='mat-medium'>
          <div className='art-medium'>
          <img src="images/gallery/IMG2.jpg" alt="" />
          </div>
      </div>
    </div>
    )
  }
  
  export  function Small() {
    return (
      <div className='interest-small'>
        <div className='mat-small'>
            <div className='art-small'>
            <img src="images/gallery/IMG2.jpg" alt="" />
            </div>
        </div>
      </div>
    )
  }
